import styled from "styled-components";

//styled-components
const TilesContainer = styled.div`
    display: flex;
`;

const SingleTile = styled.div`
    width: 300px;
    height: 240px;
    margin: 16px;
    border: 1px solid black;
    box-shadow: 0 0 5px black;
`;

//Components
const Tiles = ({ data }: any) => {
    return (
        <TilesContainer>
            {data.map((e: any) => {
                return <p>{e.name}</p>;
            })}
        </TilesContainer>
    );
};

export default Tiles;
